F[4:] - F[:- 4]) / 8.)\n    return dFdx\n\n# py-bokeh is needed if you wanna see the perf report \nwith performance_report(filename=\"dask-report.html\"):\n    t = time.perf_counter()\n    # Construct a lazy task graph \n    \n    der = Derivee(gt, 1)\n    cpt =  da.linalg.norm(der, axis=(1,2))\n\n    #arrays.validate_contract()    \n    # Submit the task graph to the scheduler\n    s = client.persist(cpt, release=True)\n    arrays.validate_contract()   \n    \n    # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it. \n    print(client.compute(s).result(), flush=True)    \n\n\n    \n# wait until computation is done\n#k = wait(s)\nprint(\"Done in \",time.perf_counter() -t,  flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"data":{"cpu":["min: 0.0%","max: 98.7%","mean: 17.7%"],"memory":["min: 101.63 MiB","max: 152.91 MiB","mean: 114.89 MiB"],"x":[5,5,5],"y":[70,55,40]},"selected":{"id":"1525"},"selection_policy":{"id":"1524"}},"id":"1214","type":"ColumnDataSource"},{"attributes":{"child":{"id":"bk-bandwidth-worker-plot"},"title":"Bandwidth (Workers)"},"id":"1407","type":"Panel"},{"attributes":{"child":{"id":"bk-task-stream-plot"},"title":"Task Stream"},"id":"1406","type":"Panel"},{"attributes":{"axis":{"id":"1226"},"coordinates":null,"group":null,"ticker":null},"id":"1229","type":"Grid"},{"attributes":{"dimensions":"width"},"id":"1142","type":"PanTool"},{"attributes":{"axis":{"id":"1048"},"coordinates":null,"group":null,"ticker":null,"visible":false},"id":"1051","type":"Grid"},{"attributes":{},"id":"1290","type":"LinearScale"},{"attributes":{"source":{"id":"1181"}},"id":"1206","type":"CDSView"},{"attributes":{"fill_alpha":{"value":0.2},"fill_color":{"value":"blue"},"hatch_alpha":{"value":0.2},"hatch_color":{"value":"blue"},"height":{"value":0.9},"line_alpha":{"value":0.2},"line_color":{"value":"blue"},"width":{"field":"bandwidth"},"x
